  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Desoto NWR for the next 15 years. This plan outlines
  the Refuge vision and purpose and describes how Desoto NWR will contribute to the
  overall mission of the Refuge System. The plan provides an introduction to the Refuge,
  an overview of the CCP process, a description of the  Refuge environment, current
  management programs, and strategies for plan implementation. Key planning issues
  include: lake management, grassland management, snow goose management, drainage,
  public use, outreach, prairie wetlands, and water quality.\",\n\t\"license_title\":
